import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
const Home=()=>{
    return(
        <>
            <div className="row justify-content-center">
                <table className="table table-responsive-md table-striped table-hover rounded shadow">
                    <thead>
                        <tr>
                            <th>Full Name</th>
                        </tr>
                    </thead>
                </table>
            </div>
        </>
    );
}

export default Home;
